package java_practice;

public class decrement {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int i=10;
		System.out.println(i--); //10
		System.out.println(i--); //9
		System.out.println(i); //8
		System.out.println(i--);//8
		System.out.println(i);//7

		

	}

}
